import React, { useState } from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";

const Header = () => {

const[userId,setUserId]=useState([])

    const userName = localStorage.getItem("userLogine");
    if (userName && userName.length) {
        const user = JSON.parse(userName);
    
setUserId(user);
    }

  return (

     

    <>
    
      <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">ItWox</Navbar.Brand>
          
          { userName ? <Nav className="me-auto">
            <Nav.Link href="#home" style={{text:"white"}}>A </Nav.Link>
            
            <Nav.Link href="#features">Comments</Nav.Link>
          </Nav> : 
          <Nav className="me-auto">
            <Nav.Link href="#home">JSON Get</Nav.Link>
            <Nav.Link href="#features">Comments</Nav.Link>
          </Nav>  }
        </Container>
        
      </Navbar>
      
    </>
  );
};

export default Header;
